import React, { useRef, useCallback, useEffect } from 'react';
import { Link, useLocation } from 'react-router-dom';
import Logo from './Logo';
import ThemeToggle from './ThemeToggle';
import SkipLink from './SkipLink';
import { useSticky, useMobileMenu, useClickOutside, useRouteChange, useTabTrap } from '../../hooks';
import styles from './Header.module.css';
import animations from '../../styles/animations.module.css';

const Header = () => {
  const isSticky = useSticky();
  const { isOpen, toggle, close } = useMobileMenu();
  const location = useLocation();
  const menuRef = useRef(null);
  const menuButtonRef = useRef(null);
  
  useClickOutside(menuRef, close);
  useRouteChange(close);
  useTabTrap(menuRef, isOpen, close);

  const handleKeyDown = useCallback((event) => {
    if (event.key === 'Escape') {
      close();
      menuButtonRef.current?.focus();
    }
  }, [close]);

  useEffect(() => {
    if (isOpen) {
      document.addEventListener('keydown', handleKeyDown);
    }
    return () => document.removeEventListener('keydown', handleKeyDown);
  }, [isOpen, handleKeyDown]);

  useEffect(() => {
    const menuElement = menuRef.current;
    if (isOpen && menuElement) {
      const firstLink = menuElement.querySelector('a');
      firstLink?.focus();
    }
  }, [isOpen]);

  const menuItems = [
    { id: 815, title: "Home", path: "/", isActive: location.pathname === "/" },
    { id: 816, title: "Statistics", path: "/statistics", isActive: location.pathname === "/statistics" },
    { id: 1463, title: "Investments", path: "/investments", isActive: location.pathname === "/investments" },
    { id: 823, title: "Services", path: "/services", isActive: location.pathname === "/services" },
    { id: 818, title: "About Us", path: "/about-us", isActive: location.pathname === "/about-us" },
    { id: 819, title: "Contact Us", path: "/contact-us", isActive: location.pathname === "/contact-us" }
  ];

  return (
    <>
      <SkipLink />
      <ThemeToggle />
      <header 
        id="sticky-header" 
        className={`header-section header-section--style3 ${isSticky ? 'header-fixed' : ''}`}
        role="banner"
      >
        <div className="header-bottom">
          <div style={{ 
            maxWidth: '1320px',
            margin: '0 auto',
            padding: '0 1rem'
          }}>
            <div className="header-wrapper">
              <Logo />
              <nav 
                className={`menu-area menu--style2 ${isOpen ? 'active' : ''} ${isOpen ? animations.menuOpen : ''}`}
                ref={menuRef}
                role="navigation"
                aria-label="Main navigation"
              >
                <ul id="menu-main-menu" className="menu menu" role="menubar">
                  {menuItems.map((item, index) => (
                    <li 
                      key={item.id}
                      itemScope="itemscope"
                      itemType="https://www.schema.org/SiteNavigationElement"
                      id={`menu-item-${item.id}`}
                      className={`menu-item menu-item-type-post_type menu-item-object-page ${item.isActive ? 'current-menu-item page_item current_page_item active' : ''} menu-item-${item.id} nav-item`}
                      role="none"
                    >
                      <Link 
                        title={item.title}
                        to={item.path}
                        className="nav-links"
                        onClick={close}
                        role="menuitem"
                        tabIndex={isOpen ? 0 : -1}
                      >
                        {item.title}
                      </Link>
                    </li>
                  ))}
                </ul>
              </nav>
              <div className="header-action">
                <div className="menu-area">
                  <div className="header-btn">
                    <Link 
                      to="/Signup-Signin"
                      className="trk-btn trk-btn--primary"
                      style={{
                        backgroundColor: '#00d094',
                        padding: '12px 28px',
                        fontSize: '16px',
                        fontWeight: '600',
                        borderRadius: '4px',
                        border: 'none',
                        boxShadow: '0 4px 12px rgba(0, 208, 148, 0.2)'
                      }}
                    >
                      <span>Join Now</span>
                    </Link>
                  </div>
                  <button
                    ref={menuButtonRef}
                    className={`header-bar d-lg-none header-bar--style2 ${isOpen ? 'active' : ''}`}
                    onClick={toggle}
                    aria-expanded={isOpen}
                    aria-label="Toggle navigation menu"
                    aria-controls="menu-main-menu"
                  >
                    <span></span>
                    <span></span>
                    <span></span>
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </header>
      <main id="main-content" tabIndex="-1">
        {/* Main content will be rendered here */}
      </main>
    </>
  );
};

export default Header;
